import React from "react";
import "./Join.css";
function Join(){
    return(
        <div className="join">
            <div></div>
            <div>
              <span>Ready to</span>
              <span>Level up</span>
            </div>
            <div>
              <span>Your Body</span>
              <span>With Us?</span>
            </div>
        </div>
    )
}
export default Join;
